import React, { Component } from "react";
import { Link } from "react-router-dom";
import cartIcon from "../cartIcon.svg";

export default class Navbar extends Component {
  render() {
    return (
      <div className="navigation navbar navbar-expand-sm navbar-dark px-sm-5">
        <ul className="navbar-nav align-itmes-center">
          <li className="nav-item ml-5">
            <Link to="/">
              <img src={coffee - cup} className="" alt="coffee_logo" />
            </Link>
          </li>
        </ul>
        <Link to="/cart" className="ml-auto">
          <span className="mr-3">
            <img src={cartIcon} className="cart_logo" alt="cart_image" />
          </span>
        </Link>
      </div>
    );
  }
}
